#
# Table structure for table `employee`
#

CREATE TABLE `employee` (
  `employeeid` varchar(25) NOT NULL default '',
  `firstname` varchar(15) NOT NULL default '',
  `middlename` varchar(15) NOT NULL default '',
  `lastname` varchar(15) NOT NULL default '',
  `telephone1` varchar(15) NOT NULL default '',
  `telephone2` varchar(15) NOT NULL default '',
  `mobile` varchar(15) NOT NULL default '',
  `fax` varchar(15) NOT NULL default '',
  `email` varchar(25) NOT NULL default '',
  `address1` varchar(30) NOT NULL default '',
  `address2` varchar(30) NOT NULL default '',
  `city` varchar(30) NOT NULL default '',
  `state` varchar(30) NOT NULL default '',
  `dateofbirth` date NOT NULL default '0000-00-00',
  `startdate` date NOT NULL default '0000-00-00',
  `enddate` date NOT NULL default '0000-00-00',
  `status` tinyint(1) NOT NULL default '1',
  PRIMARY KEY  (`employeeid`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

